(83, 'widget_text', 'a:12:{i:7;a:3:{s:5:"title";s:0:"";s:4:"text";s:345:"<a href="http://localhost/cuesko.co.nz/access/services/" onMouseOut="MM_swapImgRestore()" onMouseOver="MM_swapImage(\'What\',\'\',\'http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_03_hover.png\',1)"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_03.png" alt="What" width="223" height="222" id="What"></a>";s:6:"filter";b:0;}i:8;a:3:{s:5:"title";s:0:"";s:4:"text";s:344:"<a href="http://localhost/cuesko.co.nz/access/experience/" onMouseOut="MM_swapImgRestore()" onMouseOver="MM_swapImage(\'Who\',\'\',\'http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_05_hover.png\',1)"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_05.png" alt="Who" width="223" height="222" id="Who"></a>";s:6:"filter";b:0;}i:9;a:3:{s:5:"title";s:0:"";s:4:"text";s:350:"<a href="http://localhost/cuesko.co.nz/access/contact-us/" onMouseOut="MM_swapImgRestore()" onMouseOver="MM_swapImage(\'Where\',\'\',\'http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_07_hover.png\',1)"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/hometable_07.png" alt="Where" width="223" height="222" id="Where"></a>";s:6:"filter";b:0;}i:10;a:3:{s:5:"title";s:11:"Why Cuesko?";s:4:"text";s:1487:"<table border="0" cellspacing="2" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td style="width: 475px;">Detailed cost advice with the big picture outlook</td>\r\n</tr>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td>Proactive and Practical cost solutions</td>\r\n</tr>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td>Experience and skills to drive informed decisions</td>\r\n</tr>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td>Independent but integrated</td>\r\n</tr>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td>Cost Management based around the "<em>Cause and Effect</em> " principal</td>\r\n</tr>\r\n<tr>\r\n<td><img class="alignnone size-full wp-image-66" alt="bullet" src="http://localhost/cuesko.co.nz/wp-content/uploads/bullet.png" width="15" height="17" /></td>\r\n<td>A "<em>No Surprise</em> " culture and facilitator</td>\r\n</tr>\r\n</tbody>\r\n</table>";s:6:"filter";b:0;}i:11;a:3:{s:5:"title";s:10:"Contact Us";s:4:"text";s:348:"Please come and meet Cuesko Construction Cost Consultants at : <br />\r\nUnit 5, 40 Arrenway Drive,<br />\r\nAlbany <br />   <strong>OR</strong><br />\r\nEmail us at <a href="mailto:enquiry@cuesko.co.nz">enquiry@cuesko.co.nz</a><br />\r\nCall us on <a href="tel:+6494774880">09 477 4880</a><br /><br />\r\n<strong>We look forward to hearing from you</strong>";s:6:"filter";b:0;}i:13;a:3:{s:5:"title";s:4:"what";s:4:"text";s:394:"<div style="float: right; margin-top: -35px; margin-right: 15px;"><a href="http://localhost/cuesko.co.nz/access/services/"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/link.png"></a></div>\r\n<div style="padding-left: 10px; color : #ffffff; padding-bottom: 25px; padding-right: 10px; min-height: 63px;">The pre and post contract cost services Cuesko can deliver for you</div>";s:6:"filter";b:0;}i:14;a:3:{s:5:"title";s:3:"who";s:4:"text";s:384:"<div style="float: right; margin-top: -35px; margin-right: 15px;"><a href="http://localhost/cuesko.co.nz/access/experience/"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/link.png"></a></div>\r\n<div style="padding-left: 10px; color : #ffffff; padding-bottom: 25px; padding-right: 10px; min-height: 63px;">The faces of Cuesko, and our experience and skill sets</div>";s:6:"filter";b:0;}i:15;a:3:{s:5:"title";s:5:"where";s:4:"text";s:372:"<div style="float: right; margin-top: -35px; margin-right: 15px;"><a href="http://localhost/cuesko.co.nz/access/contact-us/"><img src="http://localhost/cuesko.co.nz/access/wp-content/uploads/link.png"></a></div>\r\n<div style="padding-left: 10px; color : #ffffff; padding-bottom: 25px; padding-right: 10px; min-height: 63px;">Where to find Cuesko and how to contact us</div>";s:6:"filter";b:0;}i:17;a:3:{s:5:"title";s:0:"";s:4:"text";s:6:"&nbsp;";s:6:"filter";b:0;}i:18;a:3:{s:5:"title";s:0:"";s:4:"text";s:6:"&nbsp;";s:6:"filter";b:0;}i:19;a:3:{s:5:"title";s:0:"";s:4:"text";s:6:"&nbsp;";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
