(166, 1, '2013-04-03 07:19:10', '2013-04-03 07:19:10', '<img class="alignleft wp-image-344 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/Screen-Shot-2014-07-22-at-12.49.24-pm.png" alt="John Giles  Quantity Surveyor / Commercial Construction Cost Specialist" width="200" height="300" />\r\n<em><strong>BSc (Hons) Quantity Surveying</strong></em>\r\n<em><strong> 24 Years Experience</strong></em>\r\n<em><strong> Commercial Cost Specialist</strong></em>\r\n\r\nJohn has over 24 years experience in the construction Industry gained in the UK and New Zealand.\r\n\r\nSince 2006 John has been based in New Zealand and has worked on some of our country\'s most significant projects, these have included AIAL Terminal and Commercial Projects, Eden Park Stadium Redevelopment for the RWC2011, the Redevelopment of Britomart Precinct, The Viaduct Events Centre, Hobsonville Marine Industry Precinct and Manukau Institute of Technology.\r\n\r\nJohn is highly experience in cost planning and is recognised as one of the best concept cost planners in the country.\r\n<div style="clear: both;"></div>\r\n[one_third]\r\n\r\n<b>COMMERCIAL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Britomart East</li>\r\n	<li>85 Customs Street</li>\r\n	<li>Quad 5</li>\r\n	<li>New Lynn Merchant Quarter</li>\r\n</ul>\r\n</div>\r\n<b>ENTERTAINMENT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Metrolanes Bowling Centre</li>\r\n	<li>Skycity Cinema Chartwell</li>\r\n	<li>Skycity Cinema Albany</li>\r\n	<li>Skycity Cinema Manukau</li>\r\n</ul>\r\n</div>\r\n<b>INDUSTRIAL</b>\r\n<div class="cv">\r\n<ul>\r\n	<li>AA and Hydraulink Buildings, Penrose</li>\r\n	<li>Hobsonville Marine Precinct</li>\r\n	<li>Laminex Development</li>\r\n	<li>AIAL Industrial Projects</li>\r\n</ul>\r\n</div>\r\n<b>EDUCATION </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Manukau Institute of Technology</li>\r\n</ul>\r\n[/one_third]\r\n\r\n</div>\r\n[one_third]\r\n\r\n<b>AVIATION </b>\r\n<ul>\r\n	<li>AIAL Stand 10 A380 Reconfiguration</li>\r\n	<li>Pier A Level 2 Departures Redevelopment</li>\r\n	<li>AIAL Domestic Terminal Refurbishment</li>\r\n	<li>AIAL Airside and Terminal Projects</li>\r\n</ul>\r\n<b>RETAIL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Pukekohe Mega Centre</li>\r\n	<li>New Lynn Merchant Quarter</li>\r\n	<li>Stoddard Road Retail Park</li>\r\n</ul>\r\n</div>\r\n<b>RESIDENTIAL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Library Lane Development</li>\r\n	<li>Greenwich Gardens, Unsworth Heights</li>\r\n	<li>the Orchards, Glenfield</li>\r\n	<li>HNZ Housing Project, Parr Road</li>\r\n	<li>Hilton Fiji</li>\r\n	<li>New Lynn Merchant Quarter</li>\r\n</ul>\r\n</div>\r\n<b>CIVIC </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Viaduct Events Centre</li>\r\n	<li>Westgate Library and Town Square</li>\r\n</ul>\r\n</div>\r\n[/one_third]\r\n[one_third_last]\r\n\r\n<b>REFURBISHMENT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Metro Centre Level 2 Restaurant Street</li>\r\n	<li>13 Gore Street</li>\r\n	<li>M &amp; C Saatchi Office</li>\r\n	<li>AIAL Terminal Projects</li>\r\n</ul>\r\n</div>\r\n<b>SPORTS FACILITIES </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Western Springs Cricket Options</li>\r\n	<li>Eden Park Redevelopment</li>\r\n	<li>Mt Smart Redevelopment Options</li>\r\n	<li>Northland Events Centre</li>\r\n	<li>Franklin Recreation Hub</li>\r\n</ul>\r\n</div>\r\n<b>LAND DEVELOPMENT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>The Airfields Masterplanning Project, Hobsonville Point</li>\r\n	<li>Park Avenue, Birkenhead Subdivision</li>\r\n	<li>Takanini School Road Subdivision</li>\r\n	<li>Beachlands Avenues</li>\r\n</ul>\r\n</div>\r\n[/one_third_last]', 'John Giles  |  Director', '', 'publish', 'open', 'open', '', 'john-giles', '', '', '2014-10-25 03:51:47', '2014-10-25 03:51:47', '', 73, 'http://localhost/cuesko.co.nz/?page_id=166', 0, 'page', '', 0),
