(181, 1, '2013-04-03 07:30:40', '2013-04-03 07:30:40', '<img class="alignleft wp-image-345 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/Screen-Shot-2014-07-22-at-12.49.43-pm.png" alt="Quantity Surveyor and Cost Consultant Greg Cutfield" width="200" height="300" />\r\n\r\n&nbsp;\r\n\r\n<strong><em>MNZIQS</em></strong>\r\n<strong><em> Quantity Surveyor - 33 Years Experience</em></strong>\r\n\r\nGreg brings expertise and knowledge from over 30 years quantity surveying experience in the New Zealand construction industry to every project.\r\n\r\nHaving owned and managed construction companies as well as holding senior roles with major QS consultancies, Greg is able to provide practical, informed advice with a balanced perspective.\r\n\r\nA strong client focus and a proactive approach to achieving practical solutions are the fundamentals underlining Greg’s approach to cost management.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n[one_third]<b>COMMERCIAL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>NZ Post House Wellington</li>\r\n	<li>Office Buildings 175, 181 &amp; 195 Khyber Pass Road</li>\r\n</ul>\r\n</div>\r\n<b>HOSPITALITY </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Menen Hotel Nauru</li>\r\n	<li>Lincoln Green Hotel</li>\r\n	<li>Universe City Accommodation</li>\r\n</ul>\r\n</div>\r\n<b>HEALTH </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>James Cook Hospital Gisborne</li>\r\n	<li>National Womens Neo-natal</li>\r\n	<li>Middlemore Geriatric Hospital</li>\r\n	<li>St John Hospital Epsom</li>\r\n	<li>Waitemata Forensic Psychiatric Unit</li>\r\n</ul>\r\n</div>\r\n<b>SPORT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Centennial Stand Alexandra Park</li>\r\n</ul>\r\n</div>\r\n[/one_third]\r\n\r\n[one_third]\r\n\r\n<b>RESIDENTIAL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Beaumont Apartments</li>\r\n	<li>Springs Rd Terraced Houses</li>\r\n	<li>HCNZ housing</li>\r\n</ul>\r\n</div>\r\n<b>CIVIC </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Hutt City Council Civic Administration</li>\r\n	<li>Tepid Baths</li>\r\n	<li>National War Memorial</li>\r\n</ul>\r\n</div>\r\n<b>RETAIL </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>New World Paraparaumu</li>\r\n	<li>KCAL Retail Development</li>\r\n	<li>Repco / Smith &amp; Smith Manukau City</li>\r\n	<li>Unsworth Heights Retail Complex</li>\r\n	<li>Service Stations, Shell, Mobil, BP</li>\r\n</ul>\r\n</div>\r\n<b>INDUSTRIAL &amp; PROCESS </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>O-I Glass bottling plant</li>\r\n	<li>Callibre Boats Factory</li>\r\n	<li>NZ Steel Glenbrook</li>\r\n	<li>Agility Logistics Office &amp; Warehouse</li>\r\n</ul>\r\n</div>\r\n[/one_third]\r\n\r\n[one_third_last]\r\n\r\n<b>EDUCATION </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Point View School – new school</li>\r\n	<li>Dilworth School Dormitory Buildings</li>\r\n	<li>Rangitoto College Classroom block</li>\r\n	<li>Murrays Bay School Hall / Gym</li>\r\n</ul>\r\n</div>\r\n<b>TRANSPORT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>New Lynn TOD</li>\r\n	<li>Dominion Rd</li>\r\n	<li>SH20 Manukau Extension</li>\r\n</ul>\r\n</div>\r\n<b>MARINE </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Centreport Wellington</li>\r\n</ul>\r\n</div>\r\n<b>LAND DEVELOPMENT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Waypoint Industrial Park</li>\r\n	<li>Whitby Coastal Estates</li>\r\n</ul>\r\n</div>\r\n[/one_third_last]\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Greg Cutfield', '', 'publish', 'open', 'open', '', 'greg-cutfield', '', '', '2014-10-25 03:36:40', '2014-10-25 03:36:40', '', 73, 'http://localhost/cuesko.co.nz/?page_id=181', 0, 'page', '', 0),
