(189, 1, '2013-04-03 07:40:37', '2013-04-03 07:40:37', '<img class="alignleft wp-image-346 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/Screen-Shot-2014-07-22-at-12.49.59-pm.png" alt="Vincent Baldwin   corporate member of the Chartered Institute of Civil Engineering Surveyors and the Quantity Surveyor Institute, " width="200" height="300" />\r\n\r\n<em><strong>MCInstCES</strong></em>\r\n<em><strong> MQSi</strong></em>\r\n<em><strong> 24 Years Experience</strong></em>\r\n\r\nVincent is a corporate member of the Chartered Institute of Civil Engineering Surveyors and the Quantity Surveyor Institute, with over 23 years of experience in the Construction industry.\r\n\r\nIn the six years he has been based in New Zealand Vincent has been appointed to NZTA Panel Positions as both a Peer Reviewer and Parallel Estimator, worked on important national infrastructure projects in Rail, Roading, Aviation, Utilities, Public Transport, Urbanisation and Land Development.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n[one_third]\r\n\r\n<b>TRANSPORT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>City Rail Link</li>\r\n	<li>SMART</li>\r\n	<li>AMETI</li>\r\n	<li>SH20 Manakau Extension</li>\r\n	<li>New Lynn TOD</li>\r\n	<li>Wynyard Crossing</li>\r\n	<li>Waterfront LRT</li>\r\n	<li>Dominion Road</li>\r\n	<li>Kiwi Rail AEP</li>\r\n	<li>Te Wero Bridge</li>\r\n	<li>Ellerslie Street Realignment</li>\r\n</ul>\r\n</div>\r\n<b>UTILITIES </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Christchurch Infrastructure Rebuild</li>\r\n	<li>Northern Grid Alliance</li>\r\n	<li>Hobson Street GXP</li>\r\n	<li>Pukete 2 WWTW</li>\r\n</ul>\r\n</div>\r\n[/one_third]\r\n\r\n[one_third]\r\n\r\n<b>LAND DEVELOPMENT </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>AIAL North Airport Development</li>\r\n	<li>AIAL Quad Development</li>\r\n	<li>AIAL Gateway Projects</li>\r\n	<li>Titanium Park – Hamilton Airport</li>\r\n	<li>Auckland Waterfront Development Master Plan</li>\r\n	<li>Westgate Plan Change 15</li>\r\n	<li>Westhaven Harbour Park Redevelopment Master Planning Team</li>\r\n	<li>St Kilda Subdivision – Cambridge</li>\r\n	<li>Oyster Capital Subdivisions</li>\r\n	<li>Northgate Industrial Park – Whangarei</li>\r\n	<li>Addison, McLennan Park, Anselmi Ridge Residential Subdivisions – McConnell Property Limited</li>\r\n	<li>Kawarau Falls Station – Queenstown</li>\r\n</ul>\r\n</div>\r\n[/one_third]\r\n\r\n[one_third_last]\r\n\r\n<b>MARINE </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>Onehunga Foreshore Restoration</li>\r\n	<li>Centreport – Wellington</li>\r\n	<li>Waterfront Auckland 20 year plan</li>\r\n	<li>ORAMS Heavy Lift System</li>\r\n	<li>ORAMS Expansion plans</li>\r\n</ul>\r\n</div>\r\n<b>AVIATION </b>\r\n<div class="cv">\r\n<ul>\r\n	<li>AIAL Taxiway Lima</li>\r\n	<li>AIAL Airside and Terminal Projects</li>\r\n</ul>\r\n</div>\r\n[/one_third_last]\r\n<table border="0" cellspacing="5" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td style="width: 350px;" valign="top"></td>\r\n<td style="width: 450px;" valign="top"></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Vincent Baldwin | Director', '', 'publish', 'open', 'open', '', 'vincent-baldwin', '', '', '2014-10-25 03:54:30', '2014-10-25 03:54:30', '', 73, 'http://localhost/cuesko.co.nz/?page_id=189', 0, 'page', '', 0),
