(218, 1, '2013-06-15 02:58:47', '2013-06-15 02:58:47', 'When planning the delivery of Quad 5, Auckland Airport’s first speculative commercial office building in a number of years; and the headquarters of the airport’s management team, it was imperative that the end product was an outstanding facility and a financial success. John Giles, as the project QS, was integral in ensuring both goals were achieved.\r\n\r\n<span style="font-size: medium;">– Donavin Wick - Property Project Manager Auckland International Airport Limited.</span>', 'Donavin Wick', '', 'publish', 'open', 'open', '', '218', '', '', '2013-10-14 03:23:44', '2013-10-14 03:23:44', '', 0, 'http://localhost/cuesko.co.nz/access/?p=218', 0, 'post', '', 0),
(222, 1, '2013-03-22 02:52:19', '2013-03-22 02:52:19', 'Over the two year life of the project John was an exceptional team member who consistently delivered high quality and reliable advice and deliverables. We’d welcome the opportunity to work with John in the future.\r\n\r\n<span style="font-size: medium;">– Donavin Wick - Property Project Manager Auckland International Airport Limited.</span>', 'Donavin Wick', '', 'publish', 'open', 'open', '', '222', '', '', '2013-10-14 03:42:46', '2013-10-14 03:42:46', '', 0, 'http://localhost/cuesko.co.nz/access/?p=222', 0, 'post', '', 0),
(223, 1, '2013-03-15 02:50:05', '2013-03-15 02:50:05', 'Vince Baldwin, with his many years of civil quantity surveying experience, was instrumental in providing sound cost planning advice as Auckland Airport undertook a review of our long term development plans in The Landing (a 120 hectare precinct). \r\n\r\n<span style="font-size: medium;">– Donavin Wick - Property Project Manager Auckland International Airport Limited.</span>', 'Donavin Wick', '', 'publish', 'open', 'open', '', '223', '', '', '2013-10-14 03:44:56', '2013-10-14 03:44:56', '', 0, 'http://localhost/cuesko.co.nz/access/?p=223', 0, 'post', '', 0),
(226, 1, '2013-04-01 02:49:20', '2013-04-01 02:49:20', 'His cost estimating and reporting abilities during the development of the detailed design of the next 10 hectare (net developable area) expansion within the precinct was invaluable in advance of getting approval to expend funds on the project.\r\n\r\n<span style="font-size: medium;">– Donavin Wick - Property Project Manager Auckland International Airport Limited.</span>', 'Donavin Wick', '', 'publish', 'open', 'open', '', '226', '', '', '2013-10-14 03:45:41', '2013-10-14 03:45:41', '', 0, 'http://localhost/cuesko.co.nz/access/?p=226', 0, 'post', '', 0) ;
