(416, 1, '2014-10-03 04:19:04', '2014-10-03 04:19:04', '<h2 style="text-align: center;">CUESKO - QUANTITY SURVEYORS &amp; CONSTRUCTION COST CONSULTANTS</h2>\r\n<h5 style="text-align: center;">Cuesko (pronounced Q-S-Co) provides national and international best practice Cost Management and advice for commercial and civil construction industries. As highly effective construction cost consultants – we are able to add significant value to your next construction project.</h5>', 'Home Block 1 - CLIENT AND PROJECT FOCUSED', '', 'publish', 'closed', 'closed', '', 'home-block-1-client-and-project-focused', '', '', '2014-10-25 04:34:48', '2014-10-25 04:34:48', '', 0, 'http://localhost/cuesko.co.nz/development/?post_type=content_block&#038;p=416', 0, 'content_block', '', 0),
(418, 1, '2014-10-03 04:21:13', '2014-10-03 04:21:13', '[one_fourth]\r\n\r\n<img class="aligncenter wp-image-69 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/icon_accurate.png" alt="Accurate Construction Cost Advice" width="68" height="68" />\r\n<h4 style="text-align: center;">Accurate Construction Cost Advice</h4>\r\n<p style="text-align: center;">The<strong> construction cost consultant</strong>s to accurately underpin more cost effective commercial strategies, more informed decision making and greatly improved construction outcomes.</p>\r\n[/one_fourth]\r\n\r\n[one_fourth]\r\n\r\n<img class="aligncenter wp-image-72 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/icon_big_picture.png" alt="Quantity Surveyors who look at the big picture " width="68" height="68" />\r\n<h4 style="text-align: center;">Detailing the Big Picture</h4>\r\n<p style="text-align: center;">The <strong>quantity surveyors</strong> to deliver a focused and detailed approach for project delivery, while sharing in our clients’ commitment to delivering ideal and ‘big picture’ outcomes every time.</p>\r\n[/one_fourth]\r\n\r\n[one_fourth]\r\n\r\n<img class="aligncenter wp-image-73 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/icon_independent.png" alt="Independently examine and advise on your construction project" width="69" height="68" />\r\n<h4 style="text-align: center;">Best Practice Delivery</h4>\r\n<p style="text-align: center;">The <em>quantity surveyors</em> who will act independently and challenge where appropriate to deliver best for project solutions, as a fully integrated member of your consultant team.</p>\r\n[/one_fourth]\r\n\r\n[one_fourth_last]\r\n\r\n<img class="aligncenter wp-image-74 size-full" src="http://localhost/cuesko.co.nz/wp-content/uploads/icon_proactive.png" alt="Proactive Quantity Surveying Solutions" width="68" height="68" />\r\n<h4 style="text-align: center;">Proactive Quantity Surveying Solutions</h4>\r\n<p style="text-align: center;">The construction cost consultants to deliver proactive advice, <a title="Risk Management, Assessment &amp; Mitigation" href="http://localhost/cuesko.co.nz/quantity-surveying-services/risk-management/">risk recognition</a> and practical cost solutions to support ideal outcomes for budget, timeline, quality and aesthetics.</p>\r\n[/one_fourth_last]', 'Home Block 2 - four icons', '', 'publish', 'closed', 'closed', '', 'home-block-2-four-icons', '', '', '2014-10-25 04:33:56', '2014-10-25 04:33:56', '', 0, 'http://localhost/cuesko.co.nz/development/?post_type=content_block&#038;p=418', 0, 'content_block', '', 0),
